import { useState, useEffect } from 'react'
import ShopWidgets from '../components/ShopWidgets'
import "../styles/shop.css"
import Products from './Products'
const Shop = () => {
  const [searchValue, setSearchValue] = useState('')
  const [cateValue, setCateValue] = useState('')
  return (
    <>
      <main >

        <section class="mainShop" style={{ height: "fit-content", width: "100%" }}>
          <ShopWidgets setSearchValue={setSearchValue} setCateValue={setCateValue} />
          <Products searchValue={searchValue} category={cateValue} />
        </section>


      </main>

    </>
  )
}

export default Shop
